import React from "react";

const Card = (props) => {
  const {
    status,
    eta,
    location_name,
    sender,
    user_name,
    user_phone,
  } = props.cardsData;
  console.log("INSIDE CARDS");
  return (
    <article className="card">
      <div>
        <h1>{user_name}</h1>
        <p>{status}</p>
        <p>{location_name}</p>
        <p>{sender}</p>
        <p>{eta}</p>
        <p>{user_phone}</p>
      </div>
    </article>
  );
};
export default Card;
